;; **
;;; ## Distributions
;; **

;; @@
(defn plot-dg-dist [[id coll]]
  (let [curr (center-degree id t0 tmax :distribution)
         dat {:xs (map first curr)
              :ys (map second curr)}]
    (gg4clj/view
      [[:<- :d (gg4clj/data-frame dat)]
       (gg4clj/r+
         [:ggplot :d [:aes :xs :ys]]
         [:geom_bar {:stat "identity" :fill "#999999"}]
         [:xlab "Degree"]
         [:ylab "Fraction"]
         [:theme_bw]
         [:ggtitle (str "Center Degree distribution of " (element-name coll))])]
      {:width 5 :height 5})))
;; @@
